/**********/
/* Custom */
/**********/

// Custom functions
$(document).ready(function()
{
  $('.link-pub').click(function(e){
    e.preventDefault();
    var tab = $(this).attr('href');
    var searchTab = tab.replace('#','');
    $('.atabcontent').hide();
    $(tab).show();
    $('.tablinks').removeClass('active');
    $('.tablinks').each(function(){
        var findSpecial = String($(this).attr('onclick'));
        if(findSpecial.indexOf(searchTab) > 0){
            $(this).addClass('active');
        }
    });
});

  if(location.hash !="" && $('.expand-wrap').length){
    $(location.hash).addClass('active');
    $(location.hash).children('.textexpand').slideDown();
  }

  $('#view-indy').on('click', function () {
    $('.industrylist').show();
    $('.view-indy').hide();
  });


  $(".expand-area").click(function() {
    if ($(this).parent().hasClass("active"))
    {
      $('.two-expand .textexpand').slideUp(300);
      $(this).parent().removeClass('active');
    }
    else
    {
      $('.two-expand .textexpand').slideUp(300);
      $('.two-expand').removeClass('active');
      $(this).closest('.two-expand').find('.textexpand').slideDown(300);
      $(this).parent().addClass('active');
    }
    return false;
  });


  //////////////////
  // Contact Form //
  //////////////////
  $('#contactForm').submit(function(event)
  {
    var name = $('#name').val();
    var email = $('#email').val();
    var phone = $('#phone').val();

    if(name == "" || name == "Name*")
    {
      $('#name').next().addClass('require');
      event.preventDefault();
    }
    if(email == "" || email == "Email*")
    {
      $('#email').next().addClass('require');
      event.preventDefault();
    }

    if(phone == "" || phone == "Phone*")
    {
      $('#phone').next().addClass('require');
      event.preventDefault();
    }
  });

  // Remove error border
  $('#contactForm input').focus(function()
  {
    $(this).next().removeClass('require');
  });


  if($('.current-menu-ancestor').length )
  {
    $('li.current-menu-ancestor').addClass('active');
  }
  $('li.current-menu-item').addClass('active');

  if($('.single-post').length )
  {
    $('li.menu-item-329').addClass('active');
  }

  if( $('.admin-bar').length )
  {
    $("#wpadminbar").appendTo("#adminfix");
  }

  //////////////////////
  // Placeholder Text //
  //////////////////////
  $('[placeholder]').each(function()
  {
    var input = $(this);

    $(input).focus(function()
    {
      if(input.val() == input.attr('placeholder'))
      {
        input.val('').removeClass("placeholder");
      }
    });

    $(input).blur(function()
    {
      if(input.val() === "" || input.val() == input.attr('placeholder'))
      {
        input.val(input.attr('placeholder')).addClass("placeholder");
      }
    });
  }).blur();

    $('.accolades').slick({
      centerMode: false,
      dots: false,
      arrows: false,
      draggable: false,
      autoplay: true,
      slidesToShow: 5,
      responsive: [
        {
          breakpoint: 1025,
          settings: {
            arrows: false,
            dots: false,
            autoplay: true,
            autoplaySpeed: 6000,
            centerMode: false,
            mobileFirst: true,
            slidesToShow: 4
          }
        },
        {
          breakpoint: 640,
          settings: {
            arrows: false,
            dots: false,
            autoplay: true,
            autoplaySpeed: 6000,
            centerMode: false,
            mobileFirst: true,
            slidesToShow: 3,
          }
        },
        {
          breakpoint: 480,
          settings: {
            arrows: false,
            dots: false,
            centerMode: false,
            slidesToShow: 2,
          }
        },
        {
          breakpoint: 360,
          settings: {
            arrows: false,
            centerMode: false,
            dots: false,
            slidesToShow: 1,
            slidesToShow: 1
          }
        }
      ]
    });



});